import { Component } from "react";
import {Header} from "../components";
import { ROUTES } from "../constants";
import {ReactComponent as IconEstandardNotes } from './svg/icono_anotacione_estandar.svg';
import { Links } from "../components/Links";
import { NotesSidePanel } from "../components/NotesSidePanel";

import { Button } from "../components/Button";
import "./styles/NotesDetail.css";
import "./styles/Home.css"

function NotesMenuNoteSelected(props){
    const links = [
        {
            link: '/',
            name: 'Anotaciones'
        },
        {
            link:'#',
            name:'Interferencia entre Especialidades'
        }
    ]
    return(
        <div className='main-content'>
                <Links links={links}/>
            <div className = 'Big-container'>
                <div className='Top-container'>
                        <IconEstandardNotes className="Note-figure"/>
                    <div>
                        <span class="Note-group">
                            ANOTACIÓN ESTÁNDAR
                        </span>
                        <span class="Date-tag">
                            Fecha:
                        </span>
                    </div>
                    <div className="Note-info">
                        <span class="Note-title">
                            Interferencia entre Especialidades
                        </span>
                        <span class="Date">
                            DD/MM/AAAA
                        </span>
                    </div>
                </div>
                <NotesSidePanel/>
            </div>

        </div>
    );
}

export {NotesMenuNoteSelected};
